const TX_STRING: &str = "";

const NONCE_STRING: &str = "DTRA9QBAUZNILATXXGQUUTNDSVWUVYNHWLFCQPJTALWLNQSIAAHDKSJCAZJHTLUPHKYYDYKMCEB999999";

const HASH_LENGTH: usize = 243;
