fn loop_cpu(lmid: &[u128; STATE_LENGTH], hmid: &[u128; STATE_LENGTH], mvm: i64) -> (i128, [i8; HASH_LENGTH]) {
    
    #[cfg(any(target_arch = "x86", target_arch = "x86_64"))]
    {
        if is_x86_feature_detected!("avx2") {
            println!("detected avx2");
            return unsafe { loop_cpu_avx2(lmid, hmid, mvm) };
        } else if is_x86_feature_detected!("sse") {
            println!("detected sse");
            return unsafe { loop_cpu_sse(lmid, hmid, mvm) };
        }
    }

    loop_cpu_fallback(lmid, hmid, mvm)
}

#[cfg(any(target_arch = "x86", target_arch = "x86_64"))]
#[target_feature(enable = "avx2")]
unsafe fn loop_cpu_avx2(lmid: &[u128; STATE_LENGTH], hmid: &[u128; STATE_LENGTH], mvm: i64) -> (i128, [i8; HASH_LENGTH]) {

    let mut nonce: [i8; HASH_LENGTH] = [0; HASH_LENGTH];

    let mut count = 0;

    let mut lmid_tmp: [__m128i; STATE_LENGTH] = [_mm_setzero_si128(); STATE_LENGTH];
    let mut hmid_tmp: [__m128i; STATE_LENGTH] = [_mm_setzero_si128(); STATE_LENGTH];
    for count in 0..STATE_LENGTH {
        lmid_tmp[count] = std::mem::transmute::<u128, __m128i>(lmid[count]);
        hmid_tmp[count] = std::mem::transmute::<u128, __m128i>(hmid[count]);
    }

    loop {
        let (incr_ret, lmid_incr, hmid_incr) = incr_sse(&lmid_tmp, &hmid_tmp);
        if incr_ret {
            break;
        }

        let (lcpy_tr, hcpy_tr) = transform64_avx2(&lmid_incr, &hmid_incr);

        let n = check_sse(&lcpy_tr, &hcpy_tr, mvm);

        // TODO DEBUG
        if count % 10000 == 0 {
            println!("count {} n {}", count, n);
        }

        if n >= 0 {
            // TODO DEBUG
            println!("count {} n {}", count, n);
            nonce = seri_sse(&lmid_incr, &hmid_incr, n);
            return (count * 128, nonce);
        }

        lmid_tmp = lmid_incr;
        hmid_tmp = hmid_incr;

        count += 1;
    }

    (-count * 128 - 1, nonce)
}

#[cfg(any(target_arch = "x86", target_arch = "x86_64"))]
#[target_feature(enable = "sse")]
unsafe fn loop_cpu_sse(lmid: &[u128; STATE_LENGTH], hmid: &[u128; STATE_LENGTH], mvm: i64) -> (i128, [i8; HASH_LENGTH]) {

    let mut nonce: [i8; HASH_LENGTH] = [0; HASH_LENGTH];

    let mut count = 0;

    let mut lmid_tmp: [__m128i; STATE_LENGTH] = [_mm_setzero_si128(); STATE_LENGTH];
    let mut hmid_tmp: [__m128i; STATE_LENGTH] = [_mm_setzero_si128(); STATE_LENGTH];
    for count in 0..STATE_LENGTH {
        lmid_tmp[count] = std::mem::transmute::<u128, __m128i>(lmid[count]);
        hmid_tmp[count] = std::mem::transmute::<u128, __m128i>(hmid[count]);
    }

    loop {
        let (incr_ret, lmid_incr, hmid_incr) = incr_sse(&lmid_tmp, &hmid_tmp);
        if incr_ret {
            break;
        }

        let (lcpy_tr, hcpy_tr) = transform64_sse(&lmid_incr, &hmid_incr);

        let n = check_sse(&lcpy_tr, &hcpy_tr, mvm);

        if n >= 0 {
            nonce = seri_sse(&lmid_incr, &hmid_incr, n);
            return (count * 128, nonce);
        }

        lmid_tmp = lmid_incr;
        hmid_tmp = hmid_incr;

        count += 1;
    }

    (-count * 128 - 1, nonce)
}

fn loop_cpu_fallback(lmid: &[u128; STATE_LENGTH], hmid: &[u128; STATE_LENGTH], mvm: i64) -> (i128, [i8; HASH_LENGTH]) {

    let mut nonce: [i8; HASH_LENGTH] = [0; HASH_LENGTH];

    let mut count = 0;

    let mut lmid_tmp: [u128; STATE_LENGTH] = *lmid;
    let mut hmid_tmp: [u128; STATE_LENGTH] = *hmid;

    loop {
        let (incr_ret, lmid_incr, hmid_incr) = incr(&lmid_tmp, &hmid_tmp);
        if incr_ret {
            break;
        }

        let (lcpy_tr, hcpy_tr) = transform64(&lmid_incr, &hmid_incr);

        let n = check(&lcpy_tr, &hcpy_tr, mvm);

        if n >= 0 {
            nonce = seri(&lmid_incr, &hmid_incr, n);
            return (count * 128, nonce);
        }

        lmid_tmp = lmid_incr;
        hmid_tmp = hmid_incr;

        count += 1;
    }

    (-count * 128 - 1, nonce)
}

#[cfg(any(target_arch = "x86", target_arch = "x86_64"))]
#[target_feature(enable = "sse")]
unsafe fn transform64_1cycle_sse(index: usize, side_from: usize, one: &__m128i, lmid_tmp: &[[__m128i; STATE_LENGTH]; 2], hmid_tmp: &[[__m128i; STATE_LENGTH]; 2]) -> (__m128i, __m128i) {

    let t1 = INDICES[index];
    let t2 = INDICES[index + 1];

    let alpha = lmid_tmp[side_from][t1];
    let beta = hmid_tmp[side_from][t1];
    let gamma = hmid_tmp[side_from][t2];

    let nalpha = _mm_andnot_si128(alpha, gamma);
    let delta =  _mm_andnot_si128(nalpha, _mm_xor_si128(lmid_tmp[side_from][t2],beta)); 

    // !delta & u128_MAX
    let lmid_ret = _mm_andnot_si128(delta, *one);

    // (alpha ^ gamma) | delta
    let hmid_ret = _mm_or_si128(_mm_xor_si128(alpha,gamma),delta);

    (lmid_ret, hmid_ret)
}

