#[target_feature(enable = "sse")]
unsafe fn incr_sse(lmid: &[__m128i; STATE_LENGTH], hmid: &[__m128i; STATE_LENGTH]) -> (bool, [__m128i; STATE_LENGTH], [__m128i; STATE_LENGTH]) {

    let mut c: [u64; 2] = [0; 2];

    let mut lmid_copy: [__m128i; STATE_LENGTH] = *lmid;
    let mut hmid_copy: [__m128i; STATE_LENGTH] = *hmid;

    let mut i = 5;
    loop {
        if HASH_LENGTH <= i || ( i != 5 && c[0] == 0) {
            // TODO cov
            break;
        }

        let low = lmid_copy[i];
        let high = hmid_copy[i];

        lmid_copy[i] = _mm_xor_si128(high, low);
        hmid_copy[i] = low;

        let carry = _mm_andnot_si128(low, high);

        c = std::mem::transmute::<__m128i, [u64; 2]>(carry);

        i += 1;
    }

    (i == HASH_LENGTH, lmid_copy, hmid_copy)
}

